  sets that describe aquifer characteristics of the alluvial and terrace deposits
  along the Cimarron River from Freedom to Guthrie in northwestern Oklahoma\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 10,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2013-03-15T21:07:53.304684\",\n\t\"name\": \"digital-data-sets-that-describe-aquifer-characteristics-of-the-alluvial-and-terrace-deposits-al115e5\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of digital aquifer
  boundaries for the alluvial and terrace deposits along the Cimarron River from Freedom
  to Guthrie in northwestern Oklahoma. Ground water in 1,305 square miles of Quaternary-age
  alluvial and terrace deposits along the Cimarron River from Freedom to Guthrie is
  an important source of water for irrigation, industrial, municipal, stock, and domestic
  supplies. Alluvial and terrace deposits are composed of interfingering lenses of
  clay, sandy clay, and cross-bedded poorly sorted sand and gravel. The aquifer is
  composed of hydraulically connected alluvial and terrace deposits that unconformably
  overlie the Permian-age Formations. The aquifer boundaries along geological contacts
  were extracted from published digital geology data sets. Additional boundaries defining
  the geographic limits of the aquifer and areas of less than 5 feet saturated thickness
  were digitized from a mylar map, at a scale of 1:250,000. The maps were published
  at a scale of 1:900,000.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
