  \"access_constraints\",\n\t\t\"value\": \"[\"Use Constraints: Features representing
  aquifer boundaries along geological contacts were extracted from the digital surficial
  geology data sets by Cederstrand, (1996a, 1996b, 1996c, 1996d) based on a scale
  of 1:250,000. Polygon boundaries defining the geographic limits of the aquifer and
  areas of less than 5 feet saturated thickness were digitized from a mylar source
  map (33 inches by 31 inches), at a scale of 1:250,000. Aquifer boundaries represented
  at these scales are indicative of broad, regional trends and should not be interpreted
  as site specific. The aquifer boundaries that were digitized from a mylar source
  map had a maximum root-mean-squared-error (RMSE) of 0.008 map inches (0.020 map
